import React from 'react';
import AllPizza from '../pizza-data';
import {Container,Row,Col} from 'react-bootstrap';
import Pizza from '../components/Pizza';

const HomeScreen = () => {
  return(
      <>
        <Container>
            <Row>
                {
                    AllPizza.map(pizza=>(
                        <col md="4">
                            <Pizza pizza={pizza}/>
                        </col>
                    ))
                }
            </Row>
        </Container>
      </>
  ) 
}

export default HomeScreen;
